import React, {useState} from "react";

function Note(props){
    const [isHovering, setIsHovering] = useState(false);

    const handleMouseOver = () => {
        setIsHovering(true);
    };

    const handleMouseOut = () => {
        setIsHovering(false);
    };
    let con =props.content
    let til =props.title
    return(
        <div className="note">
        {isHovering && 
            (<h1 onMouseOver={handleMouseOver} onMouseOut={handleMouseOut}> {isHovering ? {con} : {til}}</h1>)}
        </div>
    );
}

export default Note;
